                    override fun onReceivedData(data: String) {

                        Log.d("ECG POINTS" , "ECG POINTS $data")
                        val ecgDataPoints = parseEcgData(data)
                        plotEcgGraph(ecgDataPoints)
                    }
                    private fun parseEcgData(data: String): List<Entry> {
                        val ecgPoints = mutableListOf<Entry>()

                        val points = data.split(";")
                        for (point in points) {
                            val values = point.split(",")
                            if (values.size == 2) {
                                val x = values[0].toFloat()
                                val y = values[1].toFloat()
                                ecgPoints.add(Entry(x, y))
                            }
                        }

                        return ecgPoints
                    }

                    private fun plotEcgGraph(dataPoints: List<Entry>) {
                        val dataSet = LineDataSet(dataPoints, "ECG Data")
                        dataSet.color = Color.BLUE
                        dataSet.setDrawCircles(false)
                        dataSet.setDrawValues(false)
                         lateinit var ecgChart: LineChart
                       // ecgChart = findViewById(R.id.ecgChart)
                        val lineData = LineData(dataSet)
                        ecgChart.data = lineData
                        ecgChart.invalidate()
                    }
