    //////// this function used for get pdf from sunfox api
private suspend fun callAPI(
authorizationToken: String, verifierToken: String, requestJson: String
): String = withContext(Dispatchers.IO) {
try {
val url = URL("https://api.sunfox.in/v2/spandan/ecg-processor")
val connection = url.openConnection() as HttpURLConnection

// Set request headers
connection.requestMethod = "POST"
connection.setRequestProperty("Content-Type", "application/json")
connection.setRequestProperty("Authorization", authorizationToken)
connection.setRequestProperty("Verifier-Token", verifierToken)

// Enable output and set the request body
connection.doOutput = true
val outputStream: OutputStream = connection.outputStream
outputStream.write(requestJson.toByteArray())
outputStream.flush()
outputStream.close()

// Get the response
val responseCode = connection.responseCode

val reader = BufferedReader(InputStreamReader(connection.inputStream))
val response = StringBuilder()
var line: String?
while (reader.readLine().also { line = it } != null) {
response.append(line)
}
reader.close()

// Close the connection
connection.disconnect()

// Use the responseCode for further processing or error handling
if (responseCode == HttpURLConnection.HTTP_OK) {
response.toString()
} else {
// Handle error response
throw IOException("API request failed with response code $responseCode")
}
} catch (e: IOException) {
// Handle IO exception or network-related error
e.printStackTrace()
throw e
}


}

private fun uploadFileToAPI(fileUri: Uri, fileName: String) {
try {
val inputStream = contentResolver.openInputStream(fileUri)
if (inputStream != null) {
// Read the data from inputStream into a byte array
val byteArrayOutputStream = ByteArrayOutputStream()
val buffer = ByteArray(4096)
var bytesRead: Int
while (inputStream.read(buffer).also { bytesRead = it } != -1) {
byteArrayOutputStream.write(buffer, 0, bytesRead)
}
val pdfData = byteArrayOutputStream.toByteArray()
byteArrayOutputStream.close()

// Perform the file upload to the API using the byte array
val client = OkHttpClient()
val requestBody = MultipartBody.Builder()
.setType(MultipartBody.FORM)
.addFormDataPart(
"document",
fileName,
pdfData.toRequestBody("application/pdf".toMediaType())
)
.build()

val request = Request.Builder()
.url("http://18.60.238.252:3010/aws_document_upload")
.post(requestBody)
.build()

client.newCall(request).enqueue(object : Callback {
override fun onFailure(call: Call, e: IOException) {
e.printStackTrace()
Log.e("Upload", "Failed to upload PDF")
}

override fun onResponse(call: Call, response: Response) {
if (response.isSuccessful) {
Log.d("Upload", "PDF successfully uploaded")

} else {
Log.e("Upload", "Failed to upload PDF")
}
}


})
}
} catch (e: Exception) {
e.printStackTrace()
Log.e("Upload", "Failed to open InputStream for Uri: $fileUri")
}
}


    class CitizenApiService {
        suspend fun getCitizenData(citizenId: String): Citizen? {
            return withContext(Dispatchers.IO) {
                val client = OkHttpClient()
                val mediaType = "application/json".toMediaType()
                val requestBody = """
                {
                    "citizenId": "$citizenId",
                    "token": "123"
                }
            """.trimIndent().toRequestBody(mediaType)

                val request = Request.Builder()
                    .url("http://18.60.238.252:3010/api/citizen/citizenById")
                    .post(requestBody)
                    .addHeader("Content-Type", "application/json")
                    .build()

                try {
                    val response = client.newCall(request).execute()
                    if (response.isSuccessful) {
                        val responseData = response.body!!.string()
                        val citizen = parseCitizenData(responseData)

                        Log.d("CitizenData", "CItizen: ${responseData}")
                        citizen
                    } else {
                        Log.e("CitizenApiService", "Failed to fetch data or invalid response.")
                        null
                    }
                } catch (e: Exception) {
                    Log.e("CitizenApiService", "Error: ${e.message}")
                    null
                }


            }
        }


        private fun parseCitizenData(responseData: String): Citizen? {
            try {
                val responseJson = JSONObject(responseData)
                val dataJson = responseJson.getJSONObject("data")
                val citizensArray = dataJson.getJSONArray("data")

                if (citizensArray.length() > 0) {
                    val thirdCitizenJson = citizensArray.getJSONObject(0)

                    val firstName = thirdCitizenJson.getString("firstName")
                    val lastName = thirdCitizenJson.getString("lastName")
                    val sex = thirdCitizenJson.getString("sex")
                    val mobile = thirdCitizenJson.getString("mobile")

                    // Access the 'info' property and create an instance of Info
                    val infoObject = thirdCitizenJson.getJSONObject("info")
                    val dateOfBirth = infoObject.getString("dateOfBirth")
                    val dateOfOnBoarding = infoObject.getString("dateOfOnBoarding")
                    val rating = infoObject.getInt("rating")
                    val bloodGroup = infoObject.getString("bloodGroup")
                    val country = infoObject.getString("country")
                    val state = infoObject.getString("state")
                    val district = infoObject.getString("district")
                    val address = infoObject.getString("address")
                    val pincode = infoObject.getString("pincode")
                    val photo = infoObject.getString("photo")

                    val info = Info(

                        dateOfBirth = dateOfBirth,
                        dateOfOnBoarding = dateOfOnBoarding,
                        rating = rating,
                        bloodGroup = bloodGroup,
                        country = country,
                        state = state,
                        district = district,
                        address = address,
                        pincode = pincode,
                        photo = photo
                    )

                    // Access the 'cases' property and create a list of Case objects
                    val casesArray = thirdCitizenJson.getJSONArray("cases")
                    val casesList = mutableListOf<Case>()
                    for (i in 0 until casesArray.length()) {
                        val caseObject = casesArray.getJSONObject(i)
                        val height = caseObject.getString("height")
                        val weight = caseObject.getString("weight")
                        val caseId = caseObject.getString("caseId")

                        val case = Case(
                            status = 0, // provide appropriate values
                            height = height,
                            weight = weight,
                            caseId = caseId
                        )

                        casesList.add(case)
                    }

                    // Create and return a Citizen object with the collected data
                    return Citizen(
                        _id = "", // provide appropriate values
                        pstatus = 0, // provide appropriate values
                        citizenId = "", // provide appropriate values
                        firstName = firstName,
                        lastName = lastName,
                        isInstant = 0, // provide appropriate values
                        sex = sex,
                        mobile = mobile,
                        javixId = "", // provide appropriate values
                        citizenLoginId = "", // provide appropriate values
                        aadhaar = "", // provide appropriate values
                        screenerId = "", // provide appropriate values
                        createdAt = "", // provide appropriate values
                        info = info,
                        cases = casesList
                    )
                } else {
                    // No citizens in the array
                    Log.e("CitizenData", "No citizens found in the array.")
                }

            } catch (e: JSONException) {
                Log.e("CitizenApiService", "Error parsing JSON response: ${e.message}")
            }
            return null
        }
    }}




fun getCurrentAge(dateOfBirth: String): Int {
    val dateFormat = SimpleDateFormat("dd-MM-yyyy", Locale.getDefault())
    val birthDate = dateFormat.parse(dateOfBirth)

    val birthCalendar = Calendar.getInstance()
    birthCalendar.time = birthDate
    val currentCalendar = Calendar.getInstance()

    var age = currentCalendar.get(Calendar.YEAR) - birthCalendar.get(Calendar.YEAR)
    if (currentCalendar.get(Calendar.DAY_OF_YEAR) < birthCalendar.get(Calendar.DAY_OF_YEAR)) {
        age -= 1
    }

    return age
}


